description:
This is Empire's Digital Lo-Res re-release of the five-issue mini-series &quot;Halcyon&quot; from Image Comics, compiled into a single volume.

One corrupted (blanked) page was replaced with its intact counterpart, extracted from the 2010 Minutemen-DTs version of the issue in question - cheers! :)

